// Sidebar.js
import React, { useState } from "react";
import "./Sidebar.css";
import { Dashboard } from "../../dashboard/dashboard";
import Bluebook from "./Bluebook";
import License from "./License";
import ViewFine from "./ViewFine";
import { useNavigate, Link } from "react-router-dom";

const Sidebar = ({ setSelectedItem, isSidebarOpen, handleToggleSidebar }) => {
  const liStyle = {
    backgroundColor: "white",
    padding: "0.5rem",
    marginLeft: "-20px",
    borderRadius: "10px",
  };

  const navigate = useNavigate();

  const handleItemClick = (item) => {
    setSelectedItem(item);
    handleToggleSidebar();
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    navigate("/login"); // Redirect to login page after logout
  };

  return (
    <div
      className={`sidebar ${isSidebarOpen ? "open" : ""}`}
      style={{ backgroundColor: "#E1D0C0" }}
    >
      <div className="logo-details">
        <h1 style={{ display: isSidebarOpen ? "block" : "none" }}>
          Driver's Registration App
        </h1>
        <svg
          id="btn"
          onClick={handleToggleSidebar}
          xmlns="http://www.w3.org/2000/svg"
          width="30"
          height="30"
          fill="currentColor"
          className="bi bi-list"
          viewBox="0 0 16 16"
        >
          <path
            fillRule="evenodd"
            d="M2.5 12a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5m0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5m0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5"
          />
        </svg>
      </div>
      <div>
        <ul className="nav-list ">
          <li
            onClick={() => handleItemClick("dashboard")}
            className="aside-li pe-auto d-flex"
            style={liStyle}
          >
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="16"
              height="16"
              fill="currentColor"
              className="bi bi-house-door-fill"
              viewBox="0 0 16 16"
            >
              {/* ... */}
            </svg>
            <span className="px-2" style={{ display: isSidebarOpen ? "block" : "none" }}>
              Home
            </span>
          </li>
          <li
            onClick={() => handleItemClick("bluebook")}
            className="aside-li pe-auto d-flex"
            style={liStyle}
          >
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="16"
              height="16"
              fill="currentColor"
              className="bi bi-book-fill"
              viewBox="0 0 16 16"
            >
              {/* ... */}
            </svg>
            <span className="px-2" style={{ display: isSidebarOpen ? "block" : "none" }}>
              Bluebook
            </span>
          </li>
          <li
            onClick={() => handleItemClick("License")}
            className="aside-li pe-auto d-flex"
            style={liStyle}
          >
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="16"
              height="16"
              fill="currentColor"
              className="bi bi-journal-check"
              viewBox="0 0 16 16"
            >
              {/* ... */}
            </svg>
            <span className="px-2" style={{ display: isSidebarOpen ? "block" : "none" }}>
              License
            </span>
          </li>
          <li
            onClick={() => handleItemClick("View Fine")}
            className="aside-li pe-auto d-flex"
            style={liStyle}
          >
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="16"
              height="16"
              fill="currentColor"
              className="bi bi-journal-medical"
              viewBox="0 0 16 16"
            >
              {/* ... */}
            </svg>
            <span className="px-2" style={{ display: isSidebarOpen ? "block" : "none" }}>
              View Fine
            </span>
          </li>
        </ul>
      </div>
      <button onClick={handleLogout} className="logoutBtn bottom-0 position-absolute" style={{ width: '80%' }}>
        <svg xmlns="http://www.w3.org/2000/svg" width="30" height="16" fill="currentColor" className="bi bi-box-arrow-right" viewBox="0 0 16 16">
          {/* ... */}
        </svg>
        Logout
      </button>
    </div>
  );
};

export default Sidebar;
